import React from "react";
import { Box, Typography, Grid } from "@mui/material";
import TourContent from "./tour_content";

export default function Tours({ tours }) {
  return (
    <Box
      sx={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        textAlign: "center",
        width: "100vw",
        height: "100vh",
      }}
    >
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <Typography
            variant="h2"
            fontWeight="bold"
            sx={{
              color: "red",
              display: "inline",
              textDecoration: "underline wavy cyan 10",
            }}
          >
            <Typography
              variant="h2"
              sx={{ display: "inline", textDecoration: "underline #C00E53" }}
            >
              Our Tours
            </Typography>
          </Typography>
        </Grid>
        <Grid item xs={12}>
          <div style={{ alignItems: "center", justifyContent: "center", maxHeight: "100vh", maxWidth: "100vw" }}>
            {tours.map((tour) => {
              return <TourContent key={tour.id} {...tour}></TourContent>;
            })}
          </div>
        </Grid>
      </Grid>
    </Box>
  );
}
